      <div key={2}>
        <img src={require(`../images/slide2.jpg`)} alt="banner" />
      </div>
    ];

    return (
      <React.Fragment style={{ margin: 0, padding: 0, marginTop: "64px" }}>
        {/* <OwlCarousel options={options}>
          {this.state.json.map(carousel => (
            <div key={carousel.id}>
              <img src={carousel.url} alt="banner" />
            </div>
          ))}
        </OwlCarousel> */}
        <OwlCarousel options={options}>{items}</OwlCarousel>

        {/* Homebanner start */}
        <div
          style={{
            backgroundColor: "#0C007F",
            display: "flex",
            height: "200px",
            width: "100%",
            marginBottom: "20px",
            justifyContent: "center",
            textAlign: "center",
            alignItems: "center"
          }}
        >
          <Grid item xs={12} md={8}>
            <img src={require("../images/01.png")} alt="container-image" />
            <Typography
              component="h3"
              align="center"
              variant="h4"
              style={{ color: "white", marginTop: 10 }}
            >
              <span style={{ fontSize: 50, color: "#EC9120" }}>16 </span>
              Tahun <br /> Pengalaman
            </Typography>
          </Grid>
          <Grid item xs={12} md={8}>
            <img src={require("../images/01.png")} alt="container-image" />
            <Typography
              component="h3"
              align="center"
              variant="h4"
              style={{ color: "white", marginTop: 10 }}
            >
              <span style={{ fontSize: 50, color: "#EC9120" }}>133 </span>
              Ribu <br /> Alumni
            </Typography>
          </Grid>
          <Grid item xs={12} md={8}>
            <img src={require("../images/01.png")} alt="container-image" />
            <Typography
              component="h3"
              align="center"
              variant="h4"
              style={{ color: "white", marginTop: 10 }}
            >
              <span style={{ fontSize: 40, color: "#EC9120" }}>Ratusan </span>
              <br />
              Penghargaan
            </Typography>
          </Grid>
        </div>
        {/* Homebanner end */}

        {/* Liputan start */}
        <Container fixed>
          <Typography
            component="h1"
            align="center"
            variant="h3"
            style={{ marginTop: 40, marginBottom: 20 }}
          >
            Mamastudio pernah diliput
          </Typography>

          <Slider {...liputanSettings}>
            <Grid item xs={12} md={8}>
              <img
                style={{ width: "100%" }}
                src={require("../images/01.png")}
                alt="container-image"
              />
            </Grid>
            <Grid item xs={12} md={8}>
              <img
                style={{ width: "100%" }}
                src={require("../images/01.png")}
                alt="container-image"
              />
            </Grid>
            <Grid item xs={12} md={8}>
              <img
                style={{ width: "100%" }}
                src={require("../images/01.png")}
                alt="container-image"
              />
            </Grid>
            <Grid item xs={12} md={8}>
              <img
                style={{ width: "100%" }}
