                alt="container-image"
              />
            </Grid>
          </Slider>
        </Container>
        {/* Liputan end */}

        {/* Testimony start */}
        <Container
          style={{
            marginTop: 80,
            height: "450px"
          }}
        >
          <Container
            style={{
              borderTopLeftRadius: "20px",
              borderBottomLeftRadius: "20px",
              backgroundColor: "#F1F0FF",
              width: "80%",
              height: "400px",
              right: 0,
              position: "absolute"
            }}
          >
            <Slider
              style={{
                width: "500px",
                position: "absolute",
                top: "50%",
                height: "300px",
                left: -200,
                transform: "translateY(-50%)"
