            <Typography
              component="h2"
              variant="h3"
              style={{ color: "#EC9120", marginBottom: 20 }}
            >
              What Students Say About Us
            </Typography>
            <Typography
              component="h3"
              variant="h5"
              style={{ marginBottom: 20 }}
            >
              Minuteness of the parts
            </Typography>
            <Typography component="h3" variant="p" style={{ marginBottom: 20 }}>
              What looked like a small patch of purple grass, above five feet
              square, was moving across the sand in their direction. When it
              came near enough he perceived.
            </Typography>
          </Container>
        </Container>
        {/* Testimony end */}

        {/* Our teachers start */}
        <Container
          fixed
          style={{
            width: "90%",
            paddingTop: 20,
            height: "600px",
            borderRadius: "25px"
          }}
        >
          <Typography
            component="h3"
            variant="h4"
            style={{ marginBottom: 10, fontWeight: 700, textAlign: "center" }}
          >
            Our Teachers
          </Typography>
          <Typography
            component="h1"
            align="center"
            variant="h3"
            style={{ textAlign: "center", color: "#EC9120" }}
          >
            Experts Advisors
          </Typography>
          <Container fixed style={{ marginTop: 20, height: "500px" }}>
            <Container
              style={{
                display: "flex",
                borderRadius: "25px",
                padding: 20,
                marginTop: 20,
                height: "450px"
              }}
            >
              <Container style={{ marginLeft: "30px", position: "relative" }}>
                <Container
                  style={{
                    backgroundColor: "#F1F0FF",
                    position: "absolute",
                    bottom: 0,
                    right: 0,
                    borderRadius: "25px",
                    height: "80%",
