                >
                  <Container
                    style={{
                      position: "absolute",
                      bottom: 0,
                      right: 0,
                      borderRadius: "25px",
                      height: "50%",
                      width: "100%"
                    }}
                  >
                    <Typography variant="h4" style={{ marginBottom: "20px" }}>
                      Beatriz Brito
                    </Typography>
                    <Typography variant="h5">Science</Typography>
                  </Container>
                </Container>
                <img
                  src={require("../images/republika.jpg")}
